import React from 'react';
import './App.css';

const API_KEY = 'b41ebc557f327c6c95cd8ab3ce1b25f6'

function App() {
  const [images, setImages] = React.useState([]);

  React.useEffect(() => {
    setImages(['2', '10', '20', '25'])
    loadImages(setImages)
  }, [])



  return (
    <div className='container'>
      <div className='row justify-content-center mt-2'>Images</div>
      <div className='row mt-5'>{images.map(image => <div className='col-2'>{image}</div>)}</div>
    </div>
  );
}

export default App;

async function fetchImagesJson() {
  const response = await fetch(`https://www.flickr.com/services/rest/?method=flickr.photos.getRecent&api_key=${API_KEY}&format=json`)
  const rawJson = await response.text()

  const imagesJson = JSON.parse(rawJson.slice(14, -1))


  // if (response.status !== 200) {
  //   throw Error(body.message)
  // }
  return imagesJson.photos.photo;
}


function urlFromProperties(farmId, serverId, id, secret) {
  return `https://farm${farmId}.staticflickr.com/${serverId}/${id}_${secret}.jpg`
}

async function loadImages(setData) {
  const imagesJson = await fetchImagesJson()

  console.log(imagesJson)
}
